const mongoose = require("mongoose");

const Article_Immobiliers_Comptage_Schema = new mongoose.Schema({
 
 dateAchat:{
    type: String,
 },
 periodeAmortissement:{
    type: String,
 },
 
 prixAchat:{
    type: String,
 },
 codeCompta:{
    type: String,
 },
 
reference: {
    type: String,
  },
  designation: {
    type: String,
  },

  Emplacement: {
    type: String,
  },

  quantite1: {
    type: String,
  },
  createur1: {
    type: String,
  },
  quantite2: {
